import prettyReact from './images/react-full.jpg'

export default function NavBar() {
  function magic() {
    if (document.getElementById('image').style.width === "30px") {
      document.getElementById('image').style.width = "185px";
    } else {
      document.getElementById('image').style.width = "30px";
    }
  }
  return (
   <div className='new'>
        <img src={ prettyReact } alt='React logo' id='image'/>
        <button onClick={magic} className='button'>Click me</button>
   </div>
  );
};
